import "./App.css";
import Logo from "./Images/Monochrome-Modern-Technology-B-unscreen.gif"
function App() {
  return (
    <>
      <div>
        <h1>Hello, this is your Bug</h1>
        <img src={Logo} alt="Bug" />
      </div>
    
    </>
  );
}

export default App;
